import React from 'react';


const Profile = () => {
    return (
        <>
            <h1>Choose to view Profile</h1>
            <button className="btn btn-lg btn-info" href="/userprofile">User Profile</button>
            <button className="btn btn-lg btn-info" href="/companies">Company Profile</button>
        </>
    )
}

export default Profile;
